import React from "react";
import { connect } from 'react-redux';
import 'bootstrap/dist/css/bootstrap.min.css';

class Login extends React.Component{
    constructor(props) {
        super(props);
    }

    render(){
        return(
            <div className = "col-lg-6 col-md-6 col-sm-6 col-xs-6">
                <div className='card'>
                    <div className='card-header text-left'>Login</div>
                    <div className='card-body'>
                        <div className='row'>
                            <div className='form-group col-md-6'>
                                <label className='text-left' htmlFor='display_name'>Account Name:</label>
                                <input  type="text" id="name_field" required/>
                            </div>
                            <div className='form-group col-md-6'>
                                <label className='text-left' htmlFor='name_field'>Password:</label>
                                <input  type="text" id="password" required/>
                            </div>
                        </div>
                    </div>
                </div>

            </div>

        )
    }

}

export default connect()(Login)
